import './App.css';
import Home from './pages/Home';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';


function App() {
  return (
    <Router>
      <div>
        <switch>
          <Route path="/">
          <Home />  
          </Route>

          <Route path="/Careers">
            <Careers/>>

          </Route>  

        </switch>
      </div>
    </Router>
  );
}

export default App;
